import React, {useState} from 'react';
import {StyleSheet, View, Text, Button} from 'react-native';

const AlarmTest = ({num,color}) => {

  const [hour,setHour] = useState(0)

    return (
      <View style={{flex: 1, 
                    justifyContent: 'center',
                    alignItems: 'center',
                    margin:20,
                    padding:20,
                    backgroundColor: color}} >
            <Text style = {{fontSize: 40, flexDirection: "row"}}>
            <Button style = {{fontSize: 12,
    fontWeight: '500',
    color: 'coral'}}
                    title="+1 Hour"
                    onPress = {() => {setHour(hour+1)}}
                />
              {hour}
            </Text>
      </View>
    )
  }

const greeting = () => {console.log("Hello World!")}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    marginTop: 8,
    backgroundColor: 'aliceblue',
  },
  box: {
    width: 50,
    height: 50,
  },
  row: {
    flexDirection: 'row',
    flexWrap: 'wrap',
  },
  button: {
    paddingHorizontal: 8,
    paddingVertical: 6,
    borderRadius: 4,
    backgroundColor: 'oldlace',
    alignSelf: 'flex-start',
    marginHorizontal: '1%',
    marginBottom: 6,
    minWidth: '48%',
    textAlign: 'center',
  },
  selected: {
    backgroundColor: 'coral',
    borderWidth: 0,
  },
  buttonLabel: {
    fontSize: 12,
    fontWeight: '500',
    color: 'coral',
  },
  selectedLabel: {
    color: 'white',
  },
  label: {
    textAlign: 'center',
    marginBottom: 10,
    fontSize: 24,
  },
});

export default AlarmTest;
